import React, { Component } from "react";

class TodoList extends Component {
	render(){
		return(
			<div>
				<div className="todo-item">
					<input className="tick" type="checkbox"  readOnly/>
					<div className="text"></div>
					<div
						className="delete"
						onClick="">[지우기]</div>
				</div>
			</div>
		)
	}
}

export default TodoList;
